import React from "react";
import "./NewsBanner.css";

const NewsBanner = () => {
  return (
    <div className="NewsBanner__wrapper">
      <h1 className="NewsBanner__news">This will be the news</h1>
    </div>
  );
};

export default NewsBanner;
